script: |
  super -f text -I q612.spq | sort > q612.out

inputs:
  - name: q612.spq
    data: |
      SELECT DISTINCT + + ( - + 64 ) AS col2, + 91 FROM tab0 (FORMAT parquet) AS cor0 CROSS JOIN tab2 (FORMAT parquet) AS cor1;
  - name: tab0
  - name: tab2

outputs:
  - name: q612.out
    data: |
      -64	91
